import AboutPage from "../../pages/aboutpage/AboutPage";
import ContactPage from "../../pages/contactpage/ContactPage";
import HomePage from "../../pages/homepage/HomePage";
import Portfolio from "../../pages/portfoliopage/Portfolio";
import MenuItem from "./MenuItem";

function Menu(props) {
    
    return(
        <div id="menu">
            <ul>
                <MenuItem numara="1" page={<HomePage />} text="Anasayfa" href="/" />
                <MenuItem numara="2" page={<AboutPage />} text="Hakkımda" href="/about"  />
                <MenuItem numara="3" page={<Portfolio />} text="Portfolyo" href="/portfolio"  />
                <MenuItem numara="4" page={<ContactPage />} text="İletişim" href="/contact"  />
            </ul>
        </div>
    );
}
export default Menu;
